-- UPS only test - Has a lot of short loco's going through medium sized tunnels at once.

local Test = {}
local TestFunctions = require("scripts/test-functions")

Test.RunTime = nil

Test.OnLoad = function()
end

-- Break blueprintString in to chunks so that it can be parsed successfully.
local blueprintString = ""
blueprintString = blueprintString .. ""
blueprintString = blueprintString .. ""
blueprintString = blueprintString .. ""

---@param testName string
Test.Start = function(testName)
    TestFunctions.BuildBlueprintFromString(blueprintString, {x = 0, y = 0}, testName)
end

Test.Stop = function()
end

return Test
